import react, { Component } from 'react'
import Landing from '../../Components/Landing/Landing';
import DesktopRouter from '../../Routers/DesktopRouter';
import LogoutRouter from '../../Routers/LogoutRouter';
import JWTService from './JWTService';


class LogoutService extends Component
{
    constructor(props) {
        super(props)

        this.state = {
        }       
        
        this.logoutServices = this.logoutServices.bind(this)
       
    }
    componentDidMount() {     
        console.log("done") 
        this.logoutServices();
        console.log(this.state)
        
        }

    logoutServices()
    {
        JWTService.logout();
    }

    render(){
        return(
            <div>
            <DesktopRouter/>
            </div>
        );
    }
}

export default LogoutService;
